%% F matris bolme
%1 diags
for ir = 1:nr
    for j = 1:2
        evalin('base',['f',num2str(j+(ir-1)*4),'_',num2str((ir-1)*4+3),' = F(',num2str(j+(ir-1)*4),',',num2str((ir-1)*4+3),');']);
